import { Link } from "react-router-dom"

export function Home() {
    return (
        <>
            <h1>Home</h1>
            <Link to="/">Home</Link>
            <Link to="/create">Create</Link>
            <Link to="/stories">Stories</Link>
            <Link to="/help">Help</Link>
        </>
    )
}
